import { useEffect, useState } from "react";
import {
  Form,
  Table,
  DropdownButton,
  Dropdown,
} from "react-bootstrap";

export default function Product() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/Domain/Product")
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  }, []);

  function cl(){
    var a = document.getElementById("id");
    if(a.value == "hello"){
        document.getElementById("div").innerHTML = "true";
    }else{
        document.getElementById("div").innerHTML = "false";
    }
}

  return (
    <div>
      <h1>Products:</h1>
      <Table striped bordered hover variant="dark" style={{ width: 600 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Count protein</th>
            <th>Count fat</th>
            <th>Count uglevod</th>
          </tr>
        </thead>
        <tbody>
          {data.map((post) => {
            return (
              <tr>
                <td style={{ color: "#1e925e" }}>{post.name}</td>
                <td>{post.countProtein}</td>
                <td>{post.countFat}</td>
                <td>{post.countUgl}</td>
              </tr>
            );
          })}
        </tbody>
      </Table>
      <div>
        <h3>Фильтр</h3>
        <Form.Control id="id" type="id" placeholder="Enter eid" style={{width:200}}/>
      </div>
    </div>
  );
}
